from unittest import TestCase

from orm.entities import UploadedAudioFile
from repository.disk_repository import DiskRepository
from service.download_service import DownloadService


class MockAudioFileRepository:
    def find_by_id(self, _):
        return UploadedAudioFile("data/audio.wav", "description")


class TestDownloadService(TestCase):
    def setUp(self) -> None:
        self.download_service = DownloadService(
            MockAudioFileRepository(), DiskRepository()
        )

    def test_get_base64_content(self):
        expected_base64_string = ""
        base64 = self.download_service.get_base64_content(1)
        assert base64 == expected_base64_string
